INSERT INTO job VALUES (9,3,'MGH17_1',6,'1',6,'1','<?xml version=\"1.0\"?>\n<spksource>\n   <nonmem version=\"0.1\">\n      <constraint>\n         <ind_analysis is_estimation=\"yes\" is_restart=\"no\" mitr=\"450\">\n            <description>MGH17_1</description>\n            <data_labels>\n               <label name=\"TIME\"/>\n               <label name=\"DV\"/>\n            </data_labels>\n            <theta length=\"5\">\n               <low>\n                  <value fixed=\"no\">0.02</value>\n                  <value fixed=\"no\">0.1</value>\n                  <value fixed=\"no\">-1000</value>\n                  <value fixed=\"no\">0.001</value>\n                  <value fixed=\"no\">0.2</value>\n               </low>\n               <in>\n                  <value fixed=\"no\">50</value>\n                  <value fixed=\"no\">150</value>\n                  <value fixed=\"no\">-100</value>\n                  <value fixed=\"no\">1</value>\n                  <value fixed=\"no\">2</value>\n               </in>\n               <up>\n                  <value fixed=\"no\">500</value>\n                  <value fixed=\"no\">1500</value>\n                  <value fixed=\"no\">0</value>\n                  <value fixed=\"no\">10</value>\n                  <value fixed=\"no\">20</value>\n               </up>\n            </theta>\n            <omega dimension=\"1\" same_as_previous=\"no\" struct=\"diagonal\">\n               <in>\n                  <value fixed=\"no\">1</value>\n               </in>\n            </omega>\n            <ind_stat/>\n         </ind_analysis>\n      </constraint>\n      <model>\n         <pred>\r\nb1 = THETA(1)\r\r\nb2 = THETA(2)\r\r\nb3 = THETA(3)\r\r\nb4 = THETA(4)\r\r\nb5 = THETA(5)\r\r\nx = TIME\r\r\nF = b1 + b2*exp(-x*b4) + b3*exp(-x*b5)\r\r\nY = F + ETA(1)\r\n         </pred>\n      </model>\n      <presentation>\n         <table header=\"every\" process=\"estimation\" save_as=\"mgh17_1.out\">\n            <column appearance_order=\"1\" la