INSERT INTO job VALUES (15,3,'NELSON_2',9,'1',12,'1','<?xml version=\"1.0\"?>\n<spksource>\n   <nonmem version=\"0.1\">\n      <constraint>\n         <ind_analysis is_estimation=\"yes\" is_restart=\"no\" mitr=\"450\">\n            <description>NELSON_2</description>\n            <data_labels>\n               <label name=\"TIME\"/>\n               <label name=\"x2\"/>\n               <label name=\"DV\"/>\n            </data_labels>\n            <theta length=\"3\">\n               <low>\n                  <value fixed=\"no\">0.25</value>\n                  <value fixed=\"no\">0.0000000005</value>\n                  <value fixed=\"no\">-0.5</value>\n               </low>\n               <in>\n                  <value fixed=\"no\">2.5</value>\n                  <value fixed=\"no\">0.000000005</value>\n                  <value fixed=\"no\">-0.05</value>\n               </in>\n               <up>\n                  <value fixed=\"no\">25</value>\n                  <value fixed=\"no\">0.00000005</value>\n                  <value fixed=\"no\">-0.005</value>\n               </up>\n            </theta>\n            <omega dimension=\"1\" same_as_previous=\"no\" struct=\"diagonal\">\n               <in>\n                  <value fixed=\"no\">1</value>\n               </in>\n            </omega>\n            <ind_stat/>\n         </ind_analysis>\n      </constraint>\n      <model>\n         <pred>\r\nb1 = THETA(1)\r\r\nb2 = THETA(2)\r\r\nb3 = THETA(3)\r\r\nx1 = TIME\r\r\nF = exp ( b1 - b2*x1 * exp (-b3 * x2 ) )\r\r\nY = F + ETA(1)\r\n         </pred>\n      </model>\n      <presentation>\n         <table header=\"every\" process=\"estimation\" save_as=\"nelson_1.out\">\n            <column appearance_order=\"1\" label=\"TIME\" sort_order=\"0\"/>\n            <column appearance_order=\"2\" label=\"F\" sort_order=\"0\"/>\n            <column appearance_order=\"3\" label=\"DV\" sort_order=\"0\"/>\n            <column appearance_order=\"4\" label=\"PRED\" sort_order=\"0\"/>\n            <column appearance_order=\"5\" label=\"RES\" sort_order=\"0\"/>\n            <column appearance_order=\"6\" label=\"WRES\" sort_order=\"0\"/>\n         </table>\n      </presentation>\n   </nonmem>\n</spksource>\r\n','q2c',NULL,1082482863,1082482863,NULL,NULL);

